import "./barraNav.css";
import {Button} from "react-bootstrap";
import 'bootstrap/dist/css/bootstrap.min.css';


export default function BarraNav(){
    let buttons = (
        <div>
            <Button href="/" className="ms-2 mt-3 btn-lg" variant="secondary">Inicio</Button>
            <Button href="/PERSONAJES" className="ms-2 mt-3 btn-lg" variant="secondary"class="btn btn-outline-primary">Personaje</Button>
            <Button href="/FAVORITO" className="ms-2 mt-3 btn-lg" variant="secondary"  class="btn btn-outline-primary">Favorito</Button>
        </div>
    )

    return(
        <header>

        <nav>
            <ul>
                {buttons}
            </ul>
        </nav>
        </header>
    );
}
